package arrays;

import java.util.Arrays;

public class SwapFirstLast {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a[]= {1,2,3,4,5,6};
		int b[]=new int[a.length];
		for(int i=0;i<a.length;i++) {
			
				a[i]=b[i];
			
			System.out.println(b[i]);

		}
	
	}

}
